package dayChallFeb2021;

import java.util.HashMap;

class SolutionDay111 {
    private HashMap<Character, Integer> makeHashCnt(String s) {
        HashMap<Character, Integer> hash = new HashMap<>();
        char[] arr = s.toCharArray();
        for (char ch : arr) {
            if (hash.containsKey(ch)) {
                hash.replace(ch, hash.get(ch) + 1);
                continue;
            }
            hash.put(ch, 1);
        }
        return hash;
    }

    public boolean isAnagram(String s, String t) {
        HashMap<Character, Integer> hashS = makeHashCnt(s);
        HashMap<Character, Integer> hashT = makeHashCnt(t);
        if (hashS.size() != hashT.size())
            return false;
        for (char key : hashS.keySet()) {
            if (!hashT.containsKey(key) ||
                    !hashS.get(key).equals(hashT.get(key)))
                return false;
        }
        return true;
    }
}

public class Day111_2021 {
    public static void main(String[] args) {
        SolutionDay111 solution = new SolutionDay111();
        String inputS, inputT;
        boolean result;

        inputS = "";

        inputT = "";

        result = solution.isAnagram(inputS, inputT);
        System.out.println("true == "+result);
    }
}
